import {FETCH_TREE, ADD_NODE} from './constant';

export const fetchTree = (tree) => {
    console.log(tree);
    return ({
        type : FETCH_TREE,
        payload : tree
    })
  };

export const addNode = (tree)=>{
    return ({
        type : ADD_NODE,
        payload : tree
    })
}
